import styled from "styled-components";
import React from "react";

const Line = styled.div`
    height: 3px;
    width: 20px;
    background-color: black;
    margin: 2px;
`;
const Burg = styled.div`
    position: absolute;
    top: 2%;
    right: 10%;
`;
const Burger = () => {
    return (
        <Burg>
            <Line />
            <Line />
            <Line />
        </Burg>
    );
};

export default Burger;
